#include <stdio.h>
#include <stdbool.h>
#include <string.h>
#include <stdlib.h>

bool isAnagram(char * s, char * t){
    int hashmap[26] = { 0 };
    int counter = 0; // counts if hashmap is empty after reorganazing all letters
    for (int i = 0; s[i] != '\0'; i++) {
        hashmap[s[i] - 'a']++;
        counter++;
    }
    for (int i = 0; t[i] != '\0'; i++) {
        if (--hashmap[t[i] - 'a'] < 0) {
            return false;
        }
        counter--;
    }
    return counter == 0;
}

int* findAnagrams(char * s, char * p, int* returnSize){
    int *anagramIndexes = malloc(sizeof(int) * strlen(s));
    int anagramIndexesSize = 0;
    for (int i = 0; s[i] != '\0'; i++) {
        char *str = malloc(sizeof(char) * strlen(p) + 1);
        strncpy(str, &s[i], strlen(p));
        str[strlen(p)] = '\0';
        if (isAnagram(p, str)) {
            anagramIndexes[anagramIndexesSize++] = i;
        }
    }
    anagramIndexes = realloc(anagramIndexes, sizeof(int) * anagramIndexesSize);
    *returnSize = anagramIndexesSize;
    return anagramIndexes;
}

int main() {
    int returnSize;
    //int *anagrams = findAnagrams("cbaebabacd", "abc", &returnSize);
    char *str1 = "";
char *str2 = "";
    int *anagrams = findAnagrams(str1, str2, &returnSize);
    printf("%d %d %d", returnSize, anagrams[0], anagrams[1]);
    return 0;
}
